import React, { useEffect, useState } from "react";
import axios from "axios";

const Leaderboard = () => {
  const [leaderboardData, setLeaderboardData] = useState([]);

  useEffect(() => {
    axios.get("/leaderboard")
      .then(response => {
        setLeaderboardData(response.data);
      })
      .catch(error => {
        console.error("Error fetching leaderboard data:", error);
      });
  }, []);

  return (
    
    <div className="bg-gray-800 min-h-screen">
      <Navbar />
      <div className="container mx-auto p-6">
        <h1 className="text-3xl font-semibold text-white mb-6">Leaderboard</h1>
        <table className="w-full table-fixed">
          <thead>
            <tr>
              <th className="w-1/4 py-2">Username</th>
              <th className="w-1/4 py-2">Score</th>
              <th className="w-1/4 py-2">Average Score</th>
              <th className="w-1/4 py-2">Number of Games</th>
            </tr>
          </thead>
          <tbody>
            {leaderboardData.map((item, index) => (
              <tr key={index}>
                <td className="py-2">{item.username}</td>
                <td className="py-2">{item.score}</td>
                <td className="py-2">{item.averageScore}</td>
                <td className="py-2">{item.numberOfGames}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default Leaderboard;
